void draw_bottom_line(){
	char str[30];
	uint8_t x, y;
	
	// draw dirt
	LCD_DrawRect(0, MAX_Y-BOTTOM_SPACE, MAX_X, BOTTOM_SPACE, BOTTOM_COLOR);
	
	// draw grass
	for (y=0; y<6; y++)
		for (x=0; x < MAX_X; x++)
			LCD_SetPoint(x, y+(MAX_Y-BOTTOM_SPACE), ( (x+y) % 6 <= 3 ) ? Green : 0x1564 );
	
	sprintf(str, "Lobby: %d", lobby);
	GUI_Text(170, MAX_Y-16, (uint8_t *) str, White, BOTTOM_COLOR);
	
	sprintf(str, "%d/%d - %d/%d", ch1_count, ch1_same_lobby_count, ch2_count, ch2_same_lobby_count);
	GUI_Text(0, MAX_Y-16,(uint8_t *) str, White, BOTTOM_COLOR);
	
	sprintf(str, "%d", score);
	GUI_Text(115, MAX_Y-16, (uint8_t *) str, Yellow, BOTTOM_COLOR);
}

void update_screen_score(){
	char str[4];
	sprintf(str, "%d", score);
	GUI_Text(115, MAX_Y-16, (uint8_t *) str, Yellow, BOTTOM_COLOR);
}


void draw_bg(){
	int y, x;
	LCD_Clear(BG_COLOR);
	for (y = MAX_Y-BOTTOM_SPACE-109; y < MAX_Y - BOTTOM_SPACE; y++){
		for (x=0; x<MAX_X; x++) {
			if (y >= MAX_Y-BOTTOM_SPACE-109+24)
				LCD_SetPoint(x, y, CLOUD_COLOR);
			else
				LCD_SetPoint(x, y, sky[y-MAX_Y+BOTTOM_SPACE+109][x]);
		}
	} 
}

void clear_bird(uint16_t x, uint16_t y){
	int i, j;
	for (i = 0; i < 24; i++){
		for (j=0; j<34; j++){
			if (y+i < MAX_Y-BOTTOM_SPACE-109)
				LCD_SetPoint(x+j, y+i, BG_COLOR);
			else if (y+i >= MAX_Y-BOTTOM_SPACE-109+24)
				LCD_SetPoint(x+j, y+i, CLOUD_COLOR);
			else {
				LCD_SetPoint(x+j, y+i, sky[y+i-MAX_Y+BOTTOM_SPACE+109][x+j]);
			}
		}
	}
}

void draw_bird(uint16_t x, uint16_t y){
	int i, j;
	for (i = 0; i < BIRD_HEIGHT; i++){
		for (j=0; j<BIRD_WIDTH; j++){
			if (!(bird_image[BIRD_HEIGHT*bird_sequence + i][j]==0x0))
				LCD_SetPoint(x+j, y+i, bird_image[BIRD_HEIGHT*bird_sequence + i][j]);
		}
	}
	bird_sequence = (bird_sequence+1) % 4;
}

void draw_pipe(uint16_t x, uint16_t y){
	// y is the starting coordinate of the pipe hole
	int i, j;
	for (i = 0; i < MAX_Y-BOTTOM_SPACE; i++){
		for (j=0; j<PIPE_WIDTH; j++){
			if (i < y-26 || i > y+PIPE_HOLE_HEIGHT+26)
				LCD_SetPoint(x+j, i, pipe[j]);
		}
	}
	for(i = y - 26; i < y; i++ ){
		for (j=0; j < PIPE_WIDTH+4; j++){
			if (pipe_down[i-y+26][j] != 0x00)
				LCD_SetPoint(x+j-2, i, pipe_down[i-y+26][j]);
		}
	}
	for(i = y + PIPE_HOLE_HEIGHT+1; i <= y + PIPE_HOLE_HEIGHT + 26; i++ ){
		for (j=0; j < PIPE_WIDTH+4; j++){
			if (pipe_up[i-y-PIPE_HOLE_HEIGHT][j] != 0x00)
				LCD_SetPoint(x+j-2, i, pipe_up[i-y-PIPE_HOLE_HEIGHT][j]);
		}
	}
}

void emit_tone(unsigned int intensity){
	disable_timer(2);
	reset_timer(2);
	init_timer(2,intensity);
	enable_timer(2);
}
